import styled from 'styled-components'

const CoinRow = ({ name, symbol, quantity, image, id, user_id }) => {
    console.log(user_id)
    console.log(id)
    return (
        <CoinRowContainer>
            <div className="row">

                <img src={image} alt="" />
                <a>{name}</a>
                <p>{symbol}</p>
                <p>{quantity}</p>
            </div>
            <div></div>

        </CoinRowContainer>
    )
}

export default CoinRow

const CoinRowContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;


    .row {
        display: flex;
        align-items: center;
        /* padding-right: 24px; */

        a {
            font-size: 16px;
            width: 150px;
        }

        img {
            height: 30px;
            width: 30px;
            margin-right: 10px;
        }

    }
`
